import React from 'react'
import classes from './LogIn.module.css'

const Login = props => {

  return (
    <div className={classses.LogIn}>
      <h1>User login</h1>

      <input placeholder={'Enter email'}/>
      <input placeholder={'Enter password'}/>
    </div>
  )
}
export default Login
